
function generate() {
//converted image to base64 at https://elmah.io/tools/base64-image-encoder/
    const logoBase64 = ''





  const doc = new docx.Document({
  sections: [{
    properties: {},
    children: [
      new docx.Paragraph({
        children: [
          new docx.ImageRun({
            data: Uint8Array.from(atob(logoBase64), c =>
              c.charCodeAt(0)
                    ),
                      transformation: {
                      width: 573,
                      height: 300
                            }
                          })],
                          spacing: {
                            after: 1800
                          },
                        }),
      new docx.Paragraph({
        children: [
          new docx.TextRun({
            text: document.getElementById('ccode').value,
            bold: true,
            size: 80,

                  }),
          new docx.TextRun({
            text: document.getElementById('cname').value,
            bold: true,
            size: 80,
            break: 3,
                  }),

          new docx.TextRun({
            text: "Course Syllabus",
            bold: true,
            size: 40,
            break: 4,
                        }),
                      ],
        alignment: docx.AlignmentType.CENTER,
              }),
//Second page
//Course description
new docx.Paragraph({
  children: [
    new docx.TextRun({
      text: "Course Description",
      bold: true,
      size: 30,

                    }),
            ],
  pageBreakBefore: true,
  alignment: docx.AlignmentType.LEFT,
                  }),

              new docx.Paragraph({
                children: [
                  new docx.TextRun({
                    text: document.getElementById('cdesc').value,
                    bold: false,
                    size: 26,
                    break: 1
                          }),
                        ],
                alignment: docx.AlignmentType.JUSTIFIED,
                      }),

//Learning Objectives
new docx.Paragraph({
  children: [
    new docx.TextRun({
      text: "Student Learning Objectives",
      bold: true,
      size: 30,
      break: 1,

                    }),
            ],
  alignment: docx.AlignmentType.LEFT,
                  }),

              new docx.Paragraph({
                children: [
                  new docx.TextRun({
                    text: document.getElementById('slos').value,
                    bold: false,
                    size: 26,
                    break: 1,
                          }),
                        ],
                alignment: docx.AlignmentType.JUSTIFIED,
                      }),

//SASC
new docx.Paragraph({
  children: [
    new docx.TextRun({
      text: "Scheduling with Student Accessibility Support Services (SASC)",
      bold: true,
      size: 30,
      break: 1,

                    }),
            ],
  alignment: docx.AlignmentType.LEFT,
                  }),

              new docx.Paragraph({
                children: [
                  new docx.TextRun({
                    text: document.getElementById('sasc').value,
                    bold: false,
                    size: 26,
                    break: 1,
                          }),
                        ],
                alignment: docx.AlignmentType.JUSTIFIED,
                      }),

//AI
new docx.Paragraph({
  children: [
    new docx.TextRun({
      text: "Academic Integrity",
      bold: true,
      size: 30,
      break: 1,

                    }),
            ],
  alignment: docx.AlignmentType.LEFT,
                  }),

              new docx.Paragraph({
                children: [
                  new docx.TextRun({
                    text: document.getElementById('acadi').value,
                    bold: false,
                    size: 26,
                    break: 1,
                          }),
                        ],
                alignment: docx.AlignmentType.JUSTIFIED,
                      }),
//Critical Incident
new docx.Paragraph({
  children: [
    new docx.TextRun({
      text: "Critical Incident Management",
      bold: true,
      size: 30,
      break: 1,

                    }),
            ],
  alignment: docx.AlignmentType.LEFT,
                  }),

              new docx.Paragraph({
                children: [
                  new docx.TextRun({
                    text: document.getElementById('criti').value,
                    bold: false,
                    size: 26,
                    break: 1,
                          }),
                        ],
                alignment: docx.AlignmentType.JUSTIFIED,
                      }),


            ],
          }]
        });

  docx.Packer.toBlob(doc).then(blob => {
    console.log(blob);
    saveAs(blob, "example.docx");
    console.log("Document created successfully");

        });
      }
